    var find_array = [];
    for(var i = 0; i < arr.length; i+=1){
      var item = arr[i];
      var similar = true;
      for(var prop in params){
        if(item[prop] != params[prop]){
          similar = false;
        }
      }
      if(similar) find_array.push(item);
    }
    return find_array;
